	('cd4d0893-1bef-437d-b07a-a8f5bc5fea69', 'ðŸ—ï¸_core_infrastructure_layers_chunk_0', 'Avenir''s platform consists of six interconnected intelligence layers that work together as a unified growth engine: ### **1. Lead Intelligence & Scoring** - Real-time intent analysis (Quote Request, Partnership, Support, General Inquiry) - Tone detection (Urgent, Professional, Casual, Frustrated) - Urgency classification (High, Medium, Low) - Confidence scoring (0-100%) - Automated lead qualification - AI-generated summaries in seconds ### **2. Prospect Discovery & Enrichment** - Multi-source data collection (Apollo API, People Data Labs, Google Search) - Automated website scanning for contact forms - Email extraction from mailto: links - CAPTCHA detection and assessment - Company metadata enrichment (employee count, founded year, LinkedIn) - Geographic and industry filtering - Automation need scoring (45-95 based on business characteristics) ### **3. Automated Outreach Generation** - Personalized email templates (HTML + plain text) - Industry-specific messaging - Bilingual outreach (EN/FR) - Branded email design with logo - Demo dashboard integration - Gmail API integration for sending - Outreach tracking and logging ### **4. Bilingual CRM Communication** - Instant translation (FR â†” EN) - Language-aware responses - Quebec market optimization - Cultural adaptation (not just literal translation) - Unified inbox regardless of language ### **5. Analytics & Insight Dashboards** - Real-time lead metrics - Average confidence scores - Top intent tracking - High-urgency alerts - Client activity monitoring - Performance analytics - Predictive growth insights ### **6. Self-Learning Pipeline Optimization** - Continuous feedback loop - ICP (Ideal Customer Profile) learning - Industry performance tracking - Response pattern analysis - Automated A/B testing - Pipeline refinement based on conversion data ---', '[-0.014838493,-0.005726118,0.03656577,0.013145365,0.019445548,-0.01883515,-0.02695