	('3c32d3f2-5a29-4e73-aa89-5f8158c59a5d', 'ðŸ’¡_pain_points_solved_chunk_0', 'Avenir addresses real-world growth bottlenecks that traditional tools leave unsolved: ### **1. Fragmented Growth Stack** **Problem:** Businesses use 5+ disconnected tools (form builder, CRM, email marketing, analytics, chat) **Avenir Solution:** Unified intelligence layer that connects all touchpoints ### **2. Unresponsive Follow-Ups** **Problem:** Manual follow-up leads to 24-72 hour delays, losing hot leads **Avenir Solution:** Instant AI analysis and routing, replies in minutes (24/7) ### **3. Unstructured Lead Data** **Problem:** Forms collect data but don''t extract intent, urgency, or fit **Avenir Solution:** Every lead gets AI summary, intent classification, and confidence score ### **4. Bilingual Communication Chaos** **Problem:** Quebec businesses lose leads due to language barriers **Avenir Solution:** Automatic FR â†” EN translation with cultural adaptation ### **5. Scaling Bottlenecks** **Problem:** Growth requires hiring more people to handle more leads **Avenir Solution:** AI infrastructure that scales automatically without headcount ### **6. Data Silos** **Problem:** Lead data trapped in forms, emails scattered, no unified view **Avenir Solution:** Centralized dashboard with full lead history and relationship insights ### **7. Reactive vs. Proactive Outreach** **Problem:** Waiting for leads to come in, no systematic prospecting **Avenir Solution:** Automated prospect discovery, enrichment, and personalized outreach ---', '[-0.028555755,0.0065876846,0.040534787,0.02236294,-0.021815596,-0.028164795,-0.0059152325,0.008436928,0.0051645883,0.05654853,0.021049313,-0.057048958,-0.012487278,-0.051106356,-0.007807481,0.016654918,0.038189024,-0.016154489,-0.034592185,-0.009578533,0.03734455,0.026194355,0.041316707,-0.0014387347,-0.031214288,-0.0063491985,-0.026194355,0.053514674,0.004437402,-0.026037969,0.040034357,-0.023316884,-0.014379527,0.021706127,-0.014903414,0.018281313,0.02409