	('7b645660-5bda-4183-a1ab-d418e06c80c0', 'ðŸ”_success_indicators_(behavioral_signals)_chunk_0', 'When scanning prospects, these signals indicate strong fit: ### **High-Confidence Indicators (Each +10 to +15 points):** - âœ… Has online contact form (automatable entry point) - âœ… Active LinkedIn company page (professional presence) - âœ… 5-50 employees (sweet spot for ROI) - âœ… Founded 2015 or later (tech-ready culture) - âœ… Email address publicly available (open to outreach) - âœ… Canada-based, especially QC (bilingual need) - âœ… Multiple contact paths (/contact, /quote, /inquiry) ### **Medium-Confidence Indicators (Each +5 to +10 points):** - âœ… Website form with basic fields only (no complex CAPTCHA) - âœ… Industry: Construction, Real Estate, Marketing, Legal, Healthcare - âœ… Contact email format: contact@, info@, sales@ (professional) - âœ… Data enriched via PDL or Apollo (verified company data) - âœ… Website mentions "team" or "clients" (service business) ### **Red Flags (Each -5 to -10 points):** - âŒ No website or inactive site - âŒ 500+ employees (too large, enterprise-focused) - âŒ 1-2 employees (too small, freelancer) - âŒ Outside North America - âŒ E-commerce only (not service-based) - âŒ Heavy CAPTCHA or bot protection (indicates automation resistance) - âŒ No contact form or email (unreachable) ### **Automation Need Formula (from codebase):** ``` Base Score: - Construction, Real Estate, Home Services: 70-95 - Marketing, Legal, Healthcare: 60-90 - Other: 50-90 Adjustments: + Region CA/QC: +10 + Small team (< 50): +15 + Founded 2015+: +10 + Has form: +10 + No CAPTCHA: +10 + Verified LinkedIn: +5 + PDL/Apollo source: +10 - No form: -10 Final Score: Sum of factors (capped 45-95) ``` ---', '[-0.017212318,0.041621096,0.034362327,0.033022728,0.035483856,-0.011690357,-0.04377069,0.009642013,-0.005362299,0.040966872,0.013341493,-0.035483856,-0.004579567,-0.026620679,0.03157409,0.0646747,0.02887931,-0.057384778,-0.06034436,-0.0061138775,0.058724377,-0.003960