	('a7c281b0-2073-4d22-a724-991e37052f8f', 'Initial Outreach - AI Automation', '{{company_name}} - AI Automation Opportunity', '<div style="font-family: Arial, sans-serif; max-width: 600px; margin: 0 auto;"><h2>Hi {{contact_name}},</h2><p>I noticed {{company_name}} is in the {{industry}} space and likely dealing with {{pain_points}}.</p><p>We''ve helped similar companies in your industry achieve:</p><ul><li>3x higher lead conversion rates</li><li>Automated prospect discovery and scoring</li><li>Intelligent outreach that actually gets responses</li></ul><p>Would you be interested in a 15-minute call to discuss how AI automation could help {{company_name}} generate more qualified leads?</p><p>Best regards,<br>The Avenir AI Team</p></div>', 'Hi {{contact_name}},\n\nI noticed {{company_name}} is in the {{industry}} space and likely dealing with {{pain_points}}.\n\nWe''ve helped similar companies in your industry achieve:\n- 3x higher lead conversion rates\n- Automated prospect discovery and scoring\n- Intelligent outreach that actually gets responses\n\nWould you be interested in a 15-minute call to discuss how AI automation could help {{company_name}} generate more qualified leads?\n\nBest regards,\nThe Avenir AI Team', 'en', 'initial_outreach', '{company_name,contact_name,industry,pain_points}', '2025-10-19 17:44:52.990358+00', '2025-10-19 17:44:52.990358+00', NULL),
	('270da5df-70bd-4475-97c5-43573482fc96', 'Follow-up - Value Proposition', 'Following up on AI automation for {{company_name}}', '<div style="font-family: Arial, sans-serif; max-width: 600px; margin: 0 auto;"><h2>Hi {{contact_name}},</h2><p>I wanted to follow up on my previous email about AI automation for {{company_name}}.</p><p>Since I last reached out {{days_since_original}} days ago, I''ve been thinking about how our AI-powered lead generation system could specifically help {{company_name}} with {{pain_points}}.</p><p>Here''s what I think would be most valuable for your team:</p><ul><li>Automated prospect discovery using your ideal customer profile</li><li>Intelligent lead scoring that prioritizes the best opportunities</li><li>Personalized outreach that gets 3x higher response rates</li></ul><p>Would you be open to a brief 15-minute call this week to discuss how this could work for {{company_name}}?</p><p>Best regards,<br>The Avenir AI Team</p></div>', 'Hi {{contact_name}},\n\nI wanted to follow up on my previous email about AI automation for {{company_name}}.\n\nSince I last reached out {{days_since_original}} days ago, I''ve been thinking about how our AI-powered lead generation system could specifically help {{company_name}} with {{pain_points}}.\n\nHere''s what I think would be most valuable for your team:\n- Automated prospect discovery using your ideal customer profile\n- Intelligent lead scoring that prioritizes the best opportunities\n- Personalized outreach that gets 3x higher response rates\n\nWould you be open to a brief 15-minute call this week to discuss how this could work for {{company_name}}?\n\nBest regards,\nThe Avenir AI Team', 'en', 'follow_up', '{company_name,contact_name,pain_points,days_since_original}', '2025-10-19 17:44:52.990358+00', '2025-10-19 17:44:52.990358+00', NULL),
